package com.example.car_app;public class CarDetail {    private int carNumDetail;    private String carDescDetail;    private String argu;    public CarDetail() {    }    public CarDetail(int carNumDetail, String carDescDetail, String argu) {        this.carNumDetail = carNumDetail;        this.carDescDetail = carDescDetail;        this.argu = argu;    }    public String getArgu() {        return argu;    }    public void setArgu(String argu) {        this.argu = argu;    }    public int getCarNumDetail() {        return carNumDetail;    }    public void setCarNumDetail(int carNumDetail) {        this.carNumDetail = carNumDetail;    }    public String getCarDescDetail() {        return carDescDetail;    }    public void setCarDescDetail(String carDescDetail) {        this.carDescDetail = carDescDetail;    }    @Override    public String toString() {        return "CarDetail{" +                "carNumDetail=" + carNumDetail +                ", carDescDetail='" + carDescDetail + '\'' +                ", argu=" + argu +                '}';    }}